function drawVisualiser(bufferLenth,x,barWidth,barHeight,dataArray){
    for(let i=0;i<bufferLenth;i++){
        barHeight= 1+2*dataArray[i]/2;
        ctx.save();
        ctx.translate(canvas.width/2,canvas.height/2);
        ctx.rotate(i*Math.PI*6/bufferLenth);
        const red=i+barHeight*0.5;
        const green=i*0.5;
        const blue=barHeight;
        const alpha=1;
        const hue = i*Math.PI*2;
        
        //ctx.fillStyle = 'rgba('+red+','+green+','+blue+','+alpha+')';
        ctx.fillStyle = 'hsl('+hue+',100%,50%)';
        ctx.fillRect(0,0,barWidth,barHeight);
        x+= barWidth;
        ctx.restore();
    }


}


function oscillator(){
    const osc = audioCtx.createOscillator();
    osc.connect(audioCtx.destination);
    osc.type= 'triangle';
    osc.start();
    setTimeout(function(){
        osc.stop();
    },1000);

    

  }

    
    
    



   
